import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
   { id: "e1", title: "Some event" },
   { id: "e2", title: "Another event" },
];

function EventPage() {
   return (
      <>
         <h1>EventsPage</h1>
         <ul>
            {DUMMY_EVENTS.map((item) => (
               <li key={item.id}>
                  <Link to={`/events/${item.id}`}>{item.title}</Link>
               </li>
            ))}
         </ul>
      </>
   );
}

export default EventPage;
